import React from 'react';

/**
 * AdminReports will provide advanced reporting and analytics.  This
 * placeholder highlights the types of reports that can be generated
 * once the backend exposes the necessary data.
 */
function AdminReports() {
  return (
    <div>
      <h1 className="text-2xl font-semibold mb-4">Отчёты и аналитика</h1>
      <p className="text-gray-600">В дальнейшем здесь будут доступны детальные отчёты по продажам, клиентам, налогам и возможность строить кастомные отчёты.</p>
    </div>
  );
}

export default AdminReports;
